import React, { useEffect } from 'react';
import PropTypes from 'prop-types';
import bridge from '@vkontakte/vk-bridge';

import { Panel, PanelHeader, Header, Button, Group, Cell, Div, Avatar } from '@vkontakte/vkui';

const Home = ({ id, go, fetchedUser }) => 
{
	useEffect(()=>{
		bridge.send('VKWebAppShowSlidesSheet', {
			
			slides: [
			  {
				media: {
				  blob: 'data:image/png;base64,',
				  type: 'image'
				},
				title: 'One For Out',
				subtitle: 'One For Out- это приложение, позволяющее будущим абиуриентам, ближе познакомиться с вузом, узнать о факультетах и проходных баллах для поступления.'
				,'keys':['VKWebAppShowSlidesSheet']
			  }
			 ]})
			.then((data) => { 
			  if (!data.keys[0].value) {
				showInfoScreen()
				bridge.send('VKWebAppShowSlidesSheet',{'key':'VKWebAppShowSlidesSheet','value':'true'})
				
			  }
			})
			.catch((error) => {
			  // Ошибка
			  console.log(error);
			});
	},[])
	
	return(
	<Panel id={id}>
		<PanelHeader>OnePlace</PanelHeader>
		{fetchedUser &&
		<Group header={<Header mode="secondary">Будущий студент самого престижного вуза</Header>}>
			<Cell
				before={fetchedUser.photo_200 ? <Avatar src={fetchedUser.photo_200}/> : null}
				subtitle={fetchedUser.city && fetchedUser.city.title ? fetchedUser.city.title : ''}
			>
				{`${fetchedUser.first_name} ${fetchedUser.last_name}`}
			</Cell>
		</Group>}

		<Group header={<Header mode="secondary">Выберите город</Header>}>
			<Div>
				<Button stretched size="l" mode="secondary" onClick={go} data-to="moscow">
					Москва
				</Button>
			</Div>
			<Div>
				<Button stretched size="l" mode="secondary" onClick={go} data-to="rost">
					Ростов-на-Дону
				</Button>
			</Div>
			<Div>
				<Button stretched size="l" mode="secondary" onClick={go} data-to="piter">
					Питер
				</Button>
			</Div>
			<Div>
				<Button stretched size="l" mode="secondary" onClick={go} data-to="krasnodar">
					Краснодар
				</Button>
			</Div>
			
		</Group>

	</Panel>)
	};

Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
